  `mission_name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '任务名称',
  `mission_type` tinyint NOT NULL DEFAULT '1' COMMENT '任务类型 1-路点巡航;2-拼图航拍;3-倾斜航拍;',
  `mission_params` longblob COMMENT '航线参数',
