  `creator_id` bigint unsigned NOT NULL COMMENT '创建人id',
  `creator` varchar(12) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '创建者',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modifier_id` bigint unsigned NOT NULL DEFAULT '0' COMMENT '修改人id',
  `modifier` varchar(12) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '修改者',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `mission_extend_params` longblob COMMENT '飞航线业务扩展参数',
  PRIMARY KEY (`id`),
  UNIQUE KEY `unq_number` (`mission_id`),
  KEY `idx_type` (`mission_type`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='航线信息表';
