DROP TABLE IF EXISTS `tb_timed_tasks`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `tb_timed_tasks` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `creator_id` bigint unsigned DEFAULT NULL COMMENT '创建人id',
  `creator` varchar(191) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modifier_id` bigint unsigned DEFAULT NULL COMMENT '修改人id',
  `modifier` varchar(191) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '修改者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `timed_task_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '计划任务编号',
  `mission_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '任务编号',
  `site_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '站点编号',
  `end_site_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '降落站点编号',
  `mode` tinyint(1) NOT NULL DEFAULT '1' COMMENT '任务模式 1-单次,2-每天,3-每周,4-每月',
  `start_date` bigint NOT NULL DEFAULT '0' COMMENT '开始日期(时间戳-秒)',
  `end_date` bigint NOT NULL DEFAULT '0' COMMENT '结束日期(时间戳-秒)',
  `days` json DEFAULT NULL COMMENT '日期',
  `week_days` json DEFAULT NULL COMMENT '星期',
  `hour` tinyint(1) NOT NULL DEFAULT '0' COMMENT '小时',
  `min` tinyint(1) NOT NULL DEFAULT '0' COMMENT '分钟',
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '备注',
  `status` tinyint NOT NULL DEFAULT '1' COMMENT '状态 -1:已删除,1-正常',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_tb_timed_tasks_timed_task_id` (`timed_task_id`),
  KEY `site_status` (`site_id`,`status`),
  KEY `idx_tb_timed_tasks_mode` (`mode`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
